import axios from "axios";
import $ from 'jquery';
export default {
  name: "ImageView",

  data() {
    return {
      selectedFile: null
    };
  },

  methods: {
    onFileChanged(event) {
      this.selectedFile = event.target.files[0];
    },

    onUpload() {
      axios.post('http://localhost:8081/upload/image', this.selectedFile);
    }

  }
};
